in vec2 vUv;
out vec4 fragColor;

uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

// --- Math & Helper Constants ---
#define PI 3.14159265359
#define EPSILON 0.001
#define MAX_DIST 60.0
#define ITERATIONS 128

// --- Rotations ---
mat2 rot(float a) {
    float s = sin(a);
    float c = cos(a);
    return mat2(c, -s, s, c);
}

// --- Gyroid SDF ---
// The fundamental gyroid formula: sin(x)cos(y) + sin(y)cos(z) + sin(z)cos(x) = 0
float gyroid(vec3 p, float scale, float thickness, float bias) {
    p *= scale;
    return abs(dot(sin(p), cos(p.zxy)) - bias) / scale - thickness;
}

// --- Scene Mapping ---
float map(vec3 p) {
    // Dynamic twisting based on Z position
    float z = p.z;
    p.xy *= rot(z * 0.1 + iTime * 0.2);

    // Create layers of gyroids
    float g1 = gyroid(p, 1.5, 0.03, 0.5);
    float g2 = gyroid(p + vec3(5.0), 3.2, 0.02, 0.3);
    float g3 = gyroid(p - vec3(2.0), 0.7, 0.05, 1.2);

    // Combining them for a complex fractal-like cave structure
    float d = max(g1, -g2); // Subtraction
    d = min(d, g3);         // Addition

    // Bounds to keep the viewer inside a "tunnel"
    float tunnel = -(length(p.xy) - 4.0);

    return max(d, tunnel);
}

// --- Normal Calculation ---
vec3 getNormal(vec3 p) {
    vec2 e = vec2(EPSILON, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

// --- Color Palette ---
vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.263, 0.416, 0.557);
    return a + b * cos(6.28318 * (c * t + d + iTime * 0.1));
}

void main() {
    // Normalized pixel coordinates
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // Mouse interaction
    vec2 mouse = iMouse.xy / iResolution.xy;
    if(iMouse.z <= 0.0) mouse = vec2(0.5); // Default to center if no click

    // Camera setup
    float time = iTime * 0.5;
    vec3 ro = vec3(0.0, 0.0, time * 4.0); // Camera movement
    vec3 lookAt = ro + vec3(sin(time * 0.5) * 0.5, cos(time * 0.3) * 0.5, 1.0);

    // Orbit camera with mouse
    float yaw = (mouse.x - 0.5) * 4.0;
    float pitch = (mouse.y - 0.5) * 2.0;

    vec3 forward = normalize(lookAt - ro);
    forward.xy *= rot(pitch); // Simplistic tilt
    vec3 right = normalize(cross(vec3(0.0, 1.0, 0.0), forward));
    vec3 up = cross(forward, right);
    vec3 rd = normalize(forward + uv.x * right + uv.y * up);

    // Raymarching loop
    float d = 0.0;
    float t = 0.0;
    vec3 p;
    int i;

    for(i = 0; i < ITERATIONS; i++) {
        p = ro + rd * t;
        d = map(p);
        if(abs(d) < EPSILON || t > MAX_DIST) break;
        t += d * 0.75; // Step size slightly reduced for detail
    }

    // Shading
    vec3 col = vec3(0.0);

    if(t < MAX_DIST) {
        vec3 n = getNormal(p);
        vec3 lightDir = normalize(vec3(sin(iTime), cos(iTime), -1.0));

        // Diffuse & Specular
        float diff = max(dot(n, -lightDir), 0.0);
        float spec = pow(max(dot(reflect(rd, n), -lightDir), 0.0), 32.0);

        // Fresnel
        float fresnel = pow(1.0 + dot(rd, n), 4.0);

        // Ambient Occlusion (cheap approximation)
        float ao = clamp(1.0 - float(i) / float(ITERATIONS), 0.0, 1.0);

        // Coloring based on position and normal
        vec3 baseCol = palette(length(p.xy) * 0.1 + p.z * 0.05);
        col = baseCol * diff;
        col += vec3(0.8, 0.9, 1.0) * spec;
        col += baseCol * fresnel * 0.5;
        col *= ao;

        // Distance fog
        col = mix(col, vec3(0.02, 0.01, 0.05), 1.0 - exp(-0.02 * t * t));
    } else {
        // Background/Void
        col = vec3(0.01, 0.01, 0.03);
    }

    // Post processing
    col = pow(col, vec3(0.4545)); // Gamma correction
    col *= 1.2 - dot(uv, uv);      // Subtle vignette

    fragColor = vec4(col, 1.0);
}
